}

class Example extends PureComponent {
  render() {
    return (
      <div> 
        <h1> hello </h1>
        <BarChart
          width={500}
          height={500}
          data={data}
          layout="vertical"
          margin={{
            top: 5,
            right: 30,
            left: 20,
            bottom: 5,
          }}
        >
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis type="name" ticks={['Beginner', 'Elementary', 'Intermediate', 'Advanced', 'Expert']}/>
          <YAxis type="value" dataKey="name" />
          <Tooltip />
          <Legend />
          <Bar dataKey="value" fill="#8884d8" />
        </BarChart>
      </div>
    );
  }
}

export default Example
